    hash = hash::Sha224Algorithm().calculate("abcdefghi"); GTEST_ASSERT_EQ(hash->to_string(), "aeb35915346c584db820d2de7af3929ffafef9222a9bcb26516c7334"); delete hash;
    hash = hash::Sha224Algorithm().calculate("abcdefghij"); GTEST_ASSERT_EQ(hash->to_string(), "d35e1e5af29ddb0d7e154357df4ad9842afee527c689ee547f753188"); delete hash;
    hash = hash::Sha224Algorithm().calculate("abcdefghijk"); GTEST_ASSERT_EQ(hash->to_string(), "a2438b06c158a2e0ee5a3c90cef1b6b8fe0d8a46802ff1ba894b83c8"); delete hash;
    hash = hash::Sha224Algorithm().calculate("abcdefghijkl"); GTEST_ASSERT_EQ(hash->to_string(), "0c99b06967bf1b9fad345a843fcc040ca9cea17006b8e2bf54cc4239"); delete hash;
