    hash = hash::Sha224Algorithm().calculate("abcdefghijklmno"); GTEST_ASSERT_EQ(hash->to_string(), "71ad24fa8ade9aed5e9150ec0691ca9f9a27c1cf5f95a6cfd16d688c"); delete hash;
